import React from 'react';

import { LanguageConsumer } from './LanguageProvider';

const HeaderLang = () => {
  return (
    <LanguageConsumer>
      {(updateLanguege) => (
        <div>
          test info
          <select onChange={updateLanguege}>
            <option value="english">english</option>
            <option value="italian">italian</option>
          </select>
        </div>
      )}
    </LanguageConsumer>
  );
};

export default HeaderLang;
